// src/utils/data.js
export const rooms = ["1번 방", "2번 방", "3번 방", "4번 방", "5번 방", "6번 방", "7번 방"];
// 18:00 ~ 23:00까지 30분 단위 시간 배열 생성
export const slots = Array.from({ length: (23 - 18 + 1) * 2 }, (_, i) => {
  const hour = 18 + Math.floor(i / 2);
  const minute = i % 2 === 0 ? "00" : "30";
  return `${hour.toString().padStart(2,"0")}:${minute}`;
});
// 더미 초기 데이터 (비어있음)
export const getInitialReservations = () => [];
